import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'beta-book';
}
<div class="nav-bar">
  <h1>{{ title }}</h1>
  <nav class="nav">
    <!-- put routlinks here -->
    <a routerLink="climbs">my climbs</a>
    <a routerLink="search">search</a>
    <a routerLink="add">add</a>
  </nav>
</div>

